import React, { Fragment, useState } from 'react';
import {Form, Col, Button} from 'react-bootstrap';

const Formdate = () => {

    //Create state of dates
    const [petDate, updatePetDate] = useState({
        pet: '',
        petOwner: '',
        date: '',
        hour: '',
        symptoms: ''
    });

    //function that exect when the user writes
    const handleState = e => {
        updatePetDate({
            ...petDate,
            [e.target.name]: e.target.value
        });
        console.log(e.target.value);
    }

    return (
        <Fragment>
            <h2 className="text-center">Crear Nueva Cita</h2>
            <Form>
                <Form.Row>
                    <Form.Group as={Col}>
                        <Form.Label>Nombre mascota</Form.Label>
                        <Form.Control 
                            type="text" 
                            placeholder="Nombre mascota"
                            name="pet"
                            onChange={handleState}
                        />
                    </Form.Group>
                </Form.Row>
                <Form.Group>
                    <Form.Label>Dueño</Form.Label>
                    <Form.Control 
                        type="text" 
                        placeholder="Dueño"
                        name="petOwner"
                        onChange={handleState}
                    />
                </Form.Group>
                <Form.Group>
                    <Form.Label>Fecha</Form.Label>
                    <Form.Control 
                        type="date"
                        name="date"
                        onChange={handleState}
                    />
                </Form.Group>
                <Form.Group>
                    <Form.Label>Dueño</Form.Label>
                    <Form.Control 
                        type="time"
                        name="hour"
                        onChange={handleState}
                    />
                </Form.Group>
                <Form.Group>
                    <Form.Label>Síntomas</Form.Label>
                    <Form.Control 
                        as="textarea" 
                        rows={5}
                        name="symptoms"
                        onChange={handleState}
                    />
                </Form.Group>
                <Button
                    type="submit"
                    variant="info"
                    className="btn-block"
                >Enviar</Button>
            </Form>
        </Fragment>
    );
}

export default Formdate;
